import React from "react";
import { View, Text } from "react-native";

export default function Cart() {
  return (
    <View>
      <TextInput
        style={{
          height: 40,
          borderColor: "gray",
          borderWidth: 1,
          placeholderTextColor: "gray",
        }}
        onChangeText={(text) => setTextInputValue(text)}
        value={textInputValue}
        placeholder="Insert your text!"
      />
    </View>
  );
}
